import s from "./Nav.module.css";

// let s ={
// //   'nav': 'Nav_nav__1Ub5l',
//      'item': 'Nav_item__3opcv',
      // 'active': 'fefefefd_fefd'
// }


let classes = `${s.item}`

const Nav = () => {
  return (
    <nav className={s.nav}>
      <ul className={s.item}>
        <li>
          <a href="">Profile</a>
        </li>
      </ul>
      <ul className={s.item .active}>
        <li>
          <a href="">Messages</a>
        </li>
      </ul>
      <ul className={s.item}>
        <li>
          <a href="">Music</a>
        </li>
      </ul>
      <ul className={s.item}>
        <li>
          <a href="">News</a>
        </li>
      </ul>
      <ul className={s.item}>
        <li>
          <a href="">Setting</a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
